import React from 'react';
import Staffnavbar from './Staffnavbar';
import { useDispatch, useSelector} from 'react-redux';
import { useEffect } from 'react';
import axios from 'axios';
import { listError, listLoading, listSuccess } from '../../redux/staff/Actions';

const StaffStudent = () => {
const data = useSelector((state=>state.students))
const dispatch=useDispatch();
let handlefetch=()=>{
// dispatch(listLoading())
  axios({
    method: "get",
    url: 'http://localhost:8000/managerapi/student/',
}).then((response)=>{
 console.log(response.data);
//  dispatch(listSuccess(response));
}).catch((error)=>{
  // dispatch(listError());
  let errmessage=error.response.data.Email;
  alert("Error :"+errmessage);
})
}
useEffect(()=>{
  handlefetch
},[])
console.log(data)
  return (
    <>
    <Staffnavbar/>
    <div>
        List of Student with disable student option.
    </div>
    </>
  )
}

export default StaffStudent
